import React from 'react';
import TodoList from './components/TodoList/index';

function TodoFeature() {
  const listTask = [
    {
      id: 1,
      name: 'eat',
      status: 'new',

    },
    {
      id: 2,
      name: 'cook',
      status: 'completed',

    },
    {

      id: 3,
      name: 'code',
      status: 'new',

    }
  ]
  return (
    <div>
      <TodoList listTask={listTask}></TodoList>
    </div>
  )
};

export default TodoFeature;
